const NavBar = (props) => {

	return (

			<div className={"bg-silver items-center flex p-4"}>

				<div>{"Welcome, Beod"}</div>

				<div className={"bg-purple items-center flex justify-end grow"}>
					<input type="text" name="search" id="search" />
				</div>

			</div>
		);
}

export default NavBar;
